import { Wrapper } from './Form.styles';

const Header = () => {


     return (
        <Wrapper>
            <Content>
                <form onSubmit={handleSubmit} className = "register">
                <label>Enter email:
                <input 
                    type="text" 
                    name="email"
                    required
                    value={inputs.name} 
                    onChange={handleChange}
                />
                </label>
                <input type="submit" value="Skicka inbjudan till att redigera dokument" />
            </form> 
           </Content>

        </Wrapper>
        )        


}

export default Header
